import React from 'react'
import {Formik, Form, Field, ErrorMessage, validateYupSchema} from 'formik'
import './createCustomer.css';
import * as Yup from 'yup';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import { useEffect, useState } from 'react';

const register = () => {
  const initialValuess = { username: "", password: ""};

  const validationSchema = Yup.object().shape({
    username:Yup.string().required().min(3).max(15),
    password: Yup.string().min(4).max(20).required(),
  })

  return (
    <div>
      <div className="block">
        <div className="block_item">
            <Formik initialValues={initialValuess} validationSchema={validationSchema}>
            <Form className='block_info'>
              <label>ชื่อผู้ใช้</label>
              <ErrorMessage name="username" component="span" />
              <Field autocomplete="off" id="input" name="username" placeholder="ชื่อผู้ใช้" />
              <label>รหัสผ่าน</label>
              <ErrorMessage name="password" component="span" />
              <Field autocomplete="off" id="input" name="password" placeholder="รหัสผ่าน" />
              <button type="submit">สมัครรหัสผ่าน</button>
            </Form>
          </Formik>
        </div>
      </div>
    </div>
  )
}

export default register
